import React from 'react';
import Round_progress from './Round_progress'; // Import the Round_progress component

function Dashboard() {
  return (
    <div>
      <h1>Dashboard</h1>
      {/* Example usage of Round_progress component */}
      <Round_progress
        colour="blue"  // Example colour
        border="solid black"  // Example border
        texts={{ mainText: "Custom Main Text", subText: "Custom Sub Text" }} // Example custom texts
      />
    </div>
  );
}

export default Dashboard;
